message:
Olha como esse safado se comporta diante das verdades 🤮
O deputado federal Fábio Trad, do PSD, foi cobrado pelos seus eleitores, durante um voo comercial de Campo Grande para Brasília, nesta terça-feira (29), sobre não ter votado a favor das medidas que visam conter o ativismo judiciário.
@GeFazioBreakingNews 🇺🇸🇧🇷

